import pdb
import dis
import inspect
import tkinter as tk
import time, random, sys, base64, zlib, marshal

PLAYGROUND_WIDTH=600
PLAYGROUND_HEIGHT=600
PLAYGROUND_COLOR="#00151c"
TEXT_COLOR="white"
KEYMAP = [ 0x57, 0x55, 0x41, 0x42, 0x53, 0x4c, 0x44,
    0x52, 0x4557, 0x4e53, 0x4545, 0x5757]
BODY= b''


class BeatSaber(tk.Frame):
    def __init__(self, parent):
        tk.Frame.__init__(self, parent)
        self.core = Core()
        self.run = False
        self.board=tk.Canvas(self,
            width=PLAYGROUND_WIDTH,
            height=PLAYGROUND_HEIGHT,
            background=PLAYGROUND_COLOR)
        self.creating_playground()
        self.level = 1
        self.combo = 0
        self.speed = 10
        self.key = []
        self.blocks = []
        self.levelpass = True
        self.miss = 0
        self.multikey=[]
        parent.bind("<KeyPress>", self.keydown)
        parent.bind("<KeyRelease>", self.key_release)

    def replay(self, event=None):
        self.board.delete("all")
        self.run = False
        self.creating_playground()
        self.combo = 0
        self.speed = 5
        self.key = []
        self.blocks = []
        self.miss = 0
        self.multikey=[]
        helptxt = "LEVEL %d" % self.level
        label2 = tk.Label(self, text=helptxt, fg="white", font=("Helvetica", 50))
        label2.config(bg="systemTransparent")
        label2.pack()
        self.board.create_window(300, 370, anchor=tk.CENTER, window=label2)

    def key_release(self, event=None):
        self.block_hit("A")


    def keydown(self, event=None):
        key=event.keysym
        self.multikey.append(key)

    def creating_playground(self):
        self.board.pack()
        self.background = tk.PhotoImage(data=INTRO)
        self.board.create_image(0,0, anchor=tk.NW, image=self.background)
        self.logo = tk.PhotoImage(data=LOGO)
        self.board.create_image(300,250, anchor=tk.CENTER, image=self.logo)
        self.genbutton= tk.PhotoImage(data=BUTTON)
        label = tk.Label(self, text="PLAY", image=self.genbutton)
        label.config(bg="systemTransparent")
        label.pack()
        label.bind("<1>", self.play)
        self.board.create_window(300, 450, anchor=tk.CENTER, window=label)
        helptxt = "Use keys W, A, S, D and Arrow Keys"
        label2 = tk.Label(self, text=helptxt, fg=TEXT_COLOR, font=("Helvetica", 24))
        label2.config(bg="systemTransparent")
        label2.pack()
        self.board.create_window(300, 520, anchor=tk.CENTER, window=label2)

    def gameover(self):
        self.board.delete("all")
        self.background = tk.PhotoImage(data=INTRO)
        self.board.create_image(0,0, anchor=tk.NW, image=self.background)
        self.pusheen = tk.PhotoImage(data=FAIL)
        self.board.create_image(
            PLAYGROUND_WIDTH/2,
            PLAYGROUND_HEIGHT/2,
            anchor=tk.CENTER,
            image=self.pusheen)
        label = tk.Label(self, text="FAIL", fg=TEXT_COLOR, font=("Helvetica", 120))
        label.config(bg="systemTransparent")
        label.pack()
        self.board.create_window(PLAYGROUND_WIDTH/2, 100, anchor=tk.CENTER, window=label)
        label = tk.Label(self, text="PLAY", image=self.genbutton)
        label.config(bg="systemTransparent")
        label.pack()
        label.bind("<1>", self.replay)
        self.board.create_window(300, 500, anchor=tk.CENTER, window=label)
        self.level=1

    def success(self, flag):
        with open("flag.txt", "w") as f: #dont want to miss the flag
            f.write(str(flag))
        self.run = False
        self.board.delete("all")
        self.background = tk.PhotoImage(data=INTRO)
        self.board.create_image(0,0, anchor=tk.NW, image=self.background)
        self.pusheen = tk.PhotoImage(data=PASS)
        self.board.create_image(
            PLAYGROUND_WIDTH/2,
            PLAYGROUND_HEIGHT/2,
            anchor=tk.CENTER,
            image=self.pusheen)
        label = tk.Label(self, text=flag, bg="black", fg=TEXT_COLOR, font=("Consolas", 24))
        label.pack()
        self.board.create_window(
            PLAYGROUND_WIDTH/2,
            PLAYGROUND_HEIGHT/2,
            anchor=tk.CENTER,
            window=label)

    def move_blocks(self):
        for block in self.blocks:
            if block.y1 == 470:
                self.block_hit(block.key)
        if self.run:
            if self.miss > 5:
                self.run = False
                self.success('Insert Flag Here')
            for block in self.blocks:
                if block.y1 <= PLAYGROUND_HEIGHT+100:
                    block.move(0, self.speed)

                    print(block.key)
                elif block.active == 1 and PLAYGROUND_HEIGHT < block.y1:
                    block.active = 0
                    self.combo = 0
                    self.miss +=1
                    self.update_combo()
                    self.update_miss()
            if len(self.blocks) > 0 and self.blocks[-1].y1 > PLAYGROUND_HEIGHT+100:
                self.run = False
                self.gameover()
            if not self.blocks: #if there are no more blocks you win
                self.level+=1
                self.combo=0
                self.miss = 0
                key = "".join(self.key)
                outdata = self.core.levelup(key)
                if outdata != None:
                    print(bytes(outdata)) #bytes(outdata) is the flag
                    self.success(bytes(outdata))
                    return
                self.replay()
                self.play()

    def update_combo(self):
        self.combodisplay.config(text="COMBO %d" % self.combo)
    def update_miss(self):
        self.missdisplay.config(text="MISS %d" % self.miss)

    def block_hit(self, key):
        is_hit = True
        i = 0
        for block in self.blocks:
            key = block.key
            if block.key == key:
                if 470 <= block.y1  and block.y1 <= 600:
                    is_hit = True
                    break
            i+=1
        if is_hit:
            self.combo +=1
            self.key.append(key)
            del self.blocks[i]
            self.update_combo()

    def play(self, event=None):
        self.board.delete("all")
        self.background = tk.PhotoImage(data=GAME)
        self.board.create_image(0,0, anchor=tk.NW, image=self.background)
        self.leveldisplay = tk.Label(self, text="LEVEL %d" % self.level, fg=TEXT_COLOR, bg="black",
            font=("Helvetica", 24))
        self.leveldisplay.pack()
        self.board.create_window(3, 3, anchor=tk.NW, window=self.leveldisplay)
        self.combodisplay = tk.Label(self, text="COMBO %d" % self.combo, fg=TEXT_COLOR, bg="black",
            font=("Helvetica", 24))
        self.combodisplay.pack()
        self.board.create_window(600, 3, anchor=tk.NE, window=self.combodisplay)
        self.missdisplay = tk.Label(self, text="MISS %d" % self.combo, fg=TEXT_COLOR, bg="black",
            font=("Helvetica", 24))
        self.missdisplay.pack()
        self.board.create_window(250, 3, anchor=tk.NW, window=self.missdisplay)
        line = self.board.create_line(0, 0, 600, 0, fill=TEXT_COLOR, dash=(4, 4))
        line2 = self.board.create_line(0, 0, 600, 0, fill=TEXT_COLOR, dash=(4, 4))
        self.board.move(line, 0, 500)
        self.board.move(line2, 0, 580)
        self.blocks = self.core.get_blocks(self.board)
        self.run = True

if __name__ == '__main__':
    decompressed_data = zlib.decompress(base64.b64decode(BODY))
    exec(marshal.loads(decompressed_data))
    root = tk.Tk()
    root.title("Beat Saber CTF")
    beats = BeatSaber(root)
    beats.pack()

    while True:
        root.update()
        root.update_idletasks()
        beats.move_blocks()
